To create a Rust app that supports the ElevenLabs.io API and reads the contents of the clipboard aloud using Text-to-Speech (TTS), we'll need to break down the task into several steps. This includes setting up a Rust project, integrating the ElevenLabs API for TTS, accessing the system clipboard, and playing the audio.

First, ensure you have Rust installed on your system. You can download it from [https://www.rust-lang.org/tools/install](https://www.rust-lang.org/tools/install).

### Step 1: Create a New Rust Project

Open a terminal and run:

```bash
cargo new elevenlabs_tts
cd elevenlabs_tts
```

### Step 2: Add Dependencies

We'll need `reqwest` for making HTTP requests to the ElevenLabs API, `tokio` for async runtime, and `clipboard` for accessing the system clipboard. Add these dependencies to your `Cargo.toml`:

```toml
[package]
name = "elevenlabs_tts"
version = "0.1.0"
edition = "2021"

[dependencies]
reqwest = "0.11"
tokio = { version = "1", features = ["full"] }
clipboard = "0.5.0"
```

### Step 3: Implement Clipboard Access and ElevenLabs API Call

Now, let's write the code to access the clipboard and call the ElevenLabs API. Create a new file named `main.rs` in your project directory and replace its contents with the following code:

```rust
use clipboard::{ClipboardContext, ClipboardEvent};
use reqwest::header::{HeaderMap, HeaderValue, CONTENT_TYPE};
use std::error::Error;
use tokio;

#[tokio::main]
async fn main() -> Result<(), Box<dyn Error>> {
    // Initialize clipboard
    let mut ctx = ClipboardContext::new().unwrap();

    // Get clipboard contents
    let contents = ctx.get_contents().unwrap();

    // Set up ElevenLabs API request
    let api_key = "YOUR_ELEVENLABS_API_KEY"; // Replace with your API key
    let url = "https://api.elevenlabs.io/v1/text-to-speech/mp3";
    let client = reqwest::Client::new();
    let mut headers = HeaderMap::new();
    headers.insert(CONTENT_TYPE, HeaderValue::from_static("application/json"));
    headers.insert("api-key", HeaderValue::from_str(api_key)?);

    // Prepare JSON payload
    let payload = format!("{{\"text\":\"{}\"}}", contents);

    // Make POST request to ElevenLabs API
    let res = client
        .post(url)
        .headers(headers)
        .body(payload)
        .send()
        .await?;

    // Check if the request was successful
    if res.status().is_success() {
        // Save the response as an MP3 file
        let bytes = res.bytes().await?;
        std::fs::write("output.mp3", bytes)?;

        // Play the MP3 file (this part is platform-dependent)
        // For simplicity, we'll just print a message here.
        // You might want to use a library like `rodio` for playing audio in Rust.
        println!("Audio saved as output.mp3. Please play it manually.");
    } else {
        println!("Failed to generate audio.");
    }

    Ok(())
}
```

### Step 4: Replace `YOUR_ELEVENLABS_API_KEY` with Your Actual API Key

Make sure to replace `YOUR_ELEVENLABS_API_KEY` with your actual ElevenLabs API key.

